import React, { Component }  from 'react';
import { Bar, Line, Pie } from 'react-chartjs-2';

class Chart extends Component {
    constructor(props){
        super(props);
        this.state = {
            chartData:{
                labels:['Goal'],
                datasets:[
                    {
                        label: 'Daily Weight Goal',
                        data: [
                            1,
                            2,
                            3,
                            4
                        ],
                        backgroundColor:[
                          blue
                        ]
                    }
                ]
            }
        }
    }

    render() { 
        return ( 
         <div className="chart">
        <Line 
        data={this.state.chartData}
        options={{
            maintainAspectRatio: false
        }}
        />
         </div>
         );
    }
}

export default Chart;
